import React from "react";
import logo1 from "./Used Images/Our Service/Seo.png";
import logo2 from "./Used Images/Our Service/PPC.png";
import logo3 from "./Used Images/Our Service/Vector.png";
import logo4 from "./Used Images/Our Service/content.png";
import logo5 from "./Used Images/Our Service/Vector (2).png";
import logo6 from "./Used Images/Our Service/Vector (3).png";
import logo7 from "./Used Images/Our Service/Data driven.png";
import logo8 from "./Used Images/Our Service/Vector (4).png";
import "./OurServices.css";





let ServicesOffering = () => {
  return (<>

  <div className="container-fluid text-center logos mt-5 ">
  <h2>Our Service Offering</h2>
<p>Strategies that Drive Property Market Excellence</p>

    <div class="row g-lg-5 mt-3 fs-6 lh-base m-4 gap-3">
      <div className="col gap-3 bg-success">
       <img src={logo1} />
      <h4>Automotive SEO</h4>
      <p>Drive Your Success with Automotive SEO: Ignite Online Visibility and Outrace the Competition. Accelerate Your Business Growth Today</p>
 
      </div>
      <div className="col gap-3 bg-success">
       <img src={logo2} />
      <h4>PPC Precision</h4>
      <p>Maximize visibility and drive quality traffic with meticulously targeted Pay-Per-Click campaigns.</p>
 
      </div>
      <div className="col gap-3 bg-success">
       <img src={logo3} />
      <h4>Social Acceleration</h4>
      <p> Engage and influence your audience across social media platforms, amplifying your brand's presence and connection.</p>
 
      </div>
      <div className="col gap-3 bg-success">
       <img src={logo4} />
      <h4>Content Excellence</h4>
      <p>Craft compelling, automotive-specific content that resonates with enthusiasts and drives engagement.</p>
 
      </div>
    </div>
    <div class="row gap-3">
      <div className="col gap-3 bg-success">
        <img src={logo5} />
      <h4>Web Design</h4>
      <p>Transform visitors into customers with high-performance websites designed for seamless user experiences and increased conversions.</p>

      </div>
      <div className="col card">
        <img src={logo6} />
      <h4>Data-Driven Insights</h4>
      <p>Leverage data to refine your strategies, making informed decisions that drive revenue growth.</p>

      </div>
      <div className="col card">
       <img src={logo7} />
      <h4>End-to-End Solutions</h4>
      <p>From initial awareness to post-purchase loyalty, we offer full-funnel solutions that guide customers through every step of their journey.</p>
 
      </div>
      <div className="col card">
       <img src={logo8} />
      <h4>Video marketing</h4>
      <p>Unleash the Power of Video Marketing: Captivate, Engage, and Elevate Your Brand with Compelling Visual Stories.x</p>
 
      </div>
    </div>
  </div>
   
  </>);
}
export default ServicesOffering;

